import { Injectable } from '@angular/core';

export class Movie {
  title: string;
  description: string;
  image: string;

  constructor(title: string, description: string, image: string) {
    this.title = title;
    this.description = description;
    this.image = image;
  }
}
@Injectable({
  providedIn: 'root'
})
export class MoviesService {
  movies: Movie[] = [
    new Movie("The Lion King", "The Lion King tells the story of Simba (Swahili for lion), a young lion who is to succeed his father, Mufasa, as King of the Pride Lands; however, after Simba's paternal uncle Scar murders Mufasa, Simba is manipulated into thinking he was responsible and flees into exile.", "data:image/jpeg;base64,"),
    new Movie("Mulan", "Mulan is a girl, the only child of her honored family. When the Huns invade China, one man from every family is called to arms. Mulan's father, who has an old wound and cannot walk properly, decides to fight for his country and the honor of his family though it is clear that he will not survive an enemy encounter.", "data:image/jpeg;base64,"),
    new Movie("Cinderella","Cinderella is living a dissatisfying life, having lost both parents at a young age, and being forced to work as a scullery maid in her own château. Her stepmother, Lady Tremaine, is cruel to her, and she is jealous of Cinderella's charm and beauty.","data:image/jpeg;base64,"),
    new Movie("The Beauty and The Beast", "Beauty and the Beast focuses on the relationship between the Beast (voice of Robby Benson), a prince who is magically transformed into a monster and his servants into household objects as punishment for his arrogance, and Belle (voice of Paige O'Hara), a young woman whom he imprisons in his castle to become a prince","data:image/jpeg;base64,"),
    new Movie("Thor","Falling in love with scientist Jane Foster (Natalie Portman) teaches Thor much-needed lessons, and his new-found strength comes into play as a villain from his homeland sends dark forces toward Earth. A war is waged between the frost giants and Thor's (Chris Hemsworth's) homeland.","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSNVyblGjul8hb2XMNXGSAV4DGonNI8bzzumtKuXBnGTSwHJpXB")
  ]
  constructor() { }


  addMovie(title: string, description: string, image: string) {
    const newMovie = new Movie(title, description, image);
    this.movies.push(newMovie);
  }

  deleteMovie(i: number) {
    this.movies.splice(i, 1);
  }

  getMovies(): Movie[] {
    return this.movies;
  }
}
